import logo from './logo.svg';
import './App.css';
import useMoEngage from './hooks/useMoengage';
import useNotifications from './hooks/useNotifications'
import { useEffect } from 'react';

function App() {
  const tracker = useMoEngage();
  const enablePushNotifications = useNotifications('ruchi123');

  useEffect(() => {
    enablePushNotifications()
  }, [])

  const handleButtonClick = (buttonName) => {
    alert(`Clicked ${buttonName} button!`);
  };


  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>Welcome to My React Home Page</h1>
        <p>This is a simple home page built with React.</p>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        {''}
        <button onClick={() => tracker('NOTIFIED')}>Get Notification</button>
        <button onClick={() => tracker('Button 2')}>Button 2</button>
        <button onClick={() => tracker('Button 3')}>Button 3</button>
      <div className="home-page">
    </div>
      </header>
    </div>
  );
}

export default App;
